const mainMenus = [
  {
    label: 'Explore',
    link: '/products',
    action: 'link',
    subMenus: [
      {
        label: 'MissValentine Bra',
        link: '/category/?cid=bra',
        action: 'link',
        as: '/category/bra',
      },
      {
        label: 'MissValentine Panty',
        link: '/category/?cid=panty',
        action: 'link',
        as: '/category/panty',
      },
    ],
  },
  {
    label: <div>New&nbsp;Arrivals</div>,
    link: '/products',
    action: 'link',
  },
  {
    label: 'catalogue',
    link: '/e-catalogue',
    action: 'link',
  },
];
export default mainMenus;
